CREATE TABLE "admin_account" ("id" integer primary key autoincrement not null, "admin_name" varchar not null, "email" varchar not null, "password" varchar not null, "phone" varchar not null, "created_at" datetime, "updated_at" datetime, "photo" varchar, "gender" varchar);

CREATE TABLE "appointments" ("id" integer primary key autoincrement not null, "date" date not null, "schedule_id" integer not null, "patient_id" integer not null, "created_at" datetime, "updated_at" datetime, "former_symptoms" varchar, foreign key("schedule_id") references "dr_schedule"("id"), foreign key("patient_id") references "user_account"("id"));

CREATE TABLE "cache" ("key" varchar not null, "value" text not null, "expiration" integer not null, primary key ("key"));

CREATE TABLE "cache_locks" ("key" varchar not null, "owner" varchar not null, "expiration" integer not null, primary key ("key"));

CREATE TABLE "departments" ("id" integer primary key autoincrement not null, "dept_name" varchar not null, "created_at" datetime, "updated_at" datetime);

CREATE TABLE "doctoraccount" ("id" integer primary key autoincrement not null, "doctor_name" varchar not null, "email" varchar not null, "phone" varchar not null, "password" varchar not null, "dept_id" integer not null, "role_id" integer not null, "created_at" datetime, "updated_at" datetime, "qualifications" varchar, foreign key("dept_id") references "departments"("id"), foreign key("role_id") references "roles"("id"));

CREATE TABLE "dr_schedule" ("id" integer primary key autoincrement not null, "doctor_id" integer not null, "day" varchar not null, "shift" varchar not null, "created_at" datetime, "updated_at" datetime, foreign key("doctor_id") references "doctoraccount"("id"));

CREATE TABLE "employers" ("id" integer primary key autoincrement not null, "user_id" integer not null, "name" varchar not null, "logo" varchar not null, "created_at" datetime, "updated_at" datetime);

CREATE TABLE "jobs" ("id" integer primary key autoincrement not null, "employer_id" integer not null, "title" varchar not null, "salary" varchar not null, "schedule" varchar not null default 'Full Time', "url" varchar not null, "created_at" datetime, "updated_at" datetime);

CREATE TABLE "medical_record" ("id" integer primary key autoincrement not null, "appointment_id" integer not null, "allergies" varchar not null, "surgery_history" varchar not null, "past_med_history" varchar not null, "current_disease" varchar not null, "family_history" varchar not null, "medications" varchar not null, "created_at" datetime, "updated_at" datetime, foreign key("appointment_id") references "appointments"("id"));

CREATE TABLE "migrations" ("id" integer primary key autoincrement not null, "migration" varchar not null, "batch" integer not null);

CREATE TABLE "ms_graph_tokens" ("id" integer primary key autoincrement not null, "user_id" integer, "email" varchar, "access_token" text not null, "refresh_token" text, "expires" varchar not null, "created_at" datetime, "updated_at" datetime);

CREATE TABLE "password_reset_tokens" ("email" varchar not null, "token" varchar not null, "created_at" datetime, primary key ("email"));

CREATE TABLE "queued_failed_jobs" ("id" integer primary key autoincrement not null, "uuid" varchar not null, "connection" text not null, "queue" text not null, "payload" text not null, "exception" text not null, "failed_at" datetime not null default CURRENT_TIMESTAMP);

CREATE TABLE "queued_job_batches" ("id" varchar not null, "name" varchar not null, "total_jobs" integer not null, "pending_jobs" integer not null, "failed_jobs" integer not null, "failed_job_ids" text not null, "options" text, "cancelled_at" integer, "created_at" integer not null, "finished_at" integer, primary key ("id"));

CREATE TABLE "queued_jobs" ("id" integer primary key autoincrement not null, "queue" varchar not null, "payload" text not null, "attempts" integer not null, "reserved_at" integer, "available_at" integer not null, "created_at" integer not null);

CREATE TABLE "roles" ("id" integer primary key autoincrement not null, "role_name" varchar not null, "basic_salary" varchar not null, "created_at" datetime, "updated_at" datetime);

CREATE TABLE "sessions" ("id" varchar not null, "user_id" integer, "ip_address" varchar, "user_agent" text, "payload" text not null, "last_activity" integer not null, primary key ("id"));

CREATE TABLE sqlite_sequence(name,seq);

CREATE TABLE "user_account" ("id" integer primary key autoincrement not null, "username" varchar not null, "email" varchar not null, "phone" varchar not null, "date_of_birth" date not null, "password" varchar not null, "weight" varchar not null, "height" varchar not null, "gender" varchar not null, "blood" varchar not null, "NRC" varchar not null, "created_at" datetime, "updated_at" datetime, "photo" varchar);

CREATE TABLE "users" ("id" integer primary key autoincrement not null, "name" varchar not null, "email" varchar not null, "email_verified_at" datetime, "password" varchar not null, "remember_token" varchar, "created_at" datetime, "updated_at" datetime);






